background:#1d1d1d;
position:absolute;
z-index:2;
`

const url = "https://upload.wikimedia.org/wikipedia/it/f/f3/Fastweb_company_logo-1-.png"
const Navbar = () => {
    return(
        <>
    <Header>
    <section className = "navbar">
    <div className = "nav">
         <Link to = "/"><img src = {url} alt = "Logo" className = "logo" /></Link>
    </div>
    <div className="hamburger-menu">
    <input id="menu__toggle" type="checkbox" />
    <label className="menu__btn" for="menu__toggle">
      <span></span>
    </label>

    <ul className="menu__box">
      <li><Link to="/" className="menu__item" >Home</Link></li>
      <li><Link to="/" className="menu__item" >About</Link></li>
      <li><Link to="/" className="menu__item" >Team</Link></li>
      <li><Link to="/" className="menu__item" >Contact</Link></li>
      <li><Link to="/" className="menu__item" >Twitter</Link></li>
    </ul>
  </div>
    </section>
    </Header>
    </>
    )
}

export default Navbar;
